import React from 'react';
import { Dialog, DialogTitle, DialogContent, DialogActions, Button } from '@material-ui/core';

const AddBookMagazineDialog = (openState = false, onCloseCallback) => {

  return (
    <Dialog open={openState} onClose={onCloseCallback}>
      <DialogTitle>Add Book / Magazine</DialogTitle>
      <DialogContent>
        <DialogActions>
          <Button onClick={onCloseCallback}>
            Cancel
          </Button>
          <Button onClick={() => { console.log('jhjgjh') }} type={'primary'}>
            Add
          </Button>
        </DialogActions>
      </DialogContent>
    </Dialog>
  )
}

export default AddBookMagazineDialog;
